The contradiction is between Evidence 11 (Maya's Costume) and Testimony 4 ("I wasn't, like, scared at all. And, like, her costume looked totally, like, normal.").

Explanation: Ini claims the costume looked "totally, like, normal" when Maya/"her sister" visited, but Maya's Costume has a bullet hole and blood on it from the murder. If Ini really saw her right after the murder, she should have noticed the robe was damaged and bloodied—clearly not "normal."

