Testimony 3 states: "I figured if the place wasn't hot already, it was gonna be, so I split." This implies that Furio Tigre took one look into the restaurant, saw the dead body, got scared, and left, without ever actually entering the restaurant or interacting with anything inside.

However, Evidence 24, the Tres Bien Matches, were found at Tender Lender. These matches are only available inside Tres Bien (found just inside the front door, as noted by Gumshoe’s investigation), and thus couldn't have gotten to Tender Lender unless Tigre had actually entered Tres Bien and taken them. This demonstrates Tigre is lying about simply looking in and leaving.

