The key contradiction concerns the witness's claim about how she observed the events on Dusky Bridge. Melissa (Testimony 3: "That's when I hurried and took the photo that shows the crucial moment.") claims to have witnessed and photographed the fight from the south of the bridge, where she was surrounded by tall cliffs.

However, Evidence 2 (Dusky Bridge Map) shows that the view from the south of the bridge to the parking lot (i.e., towards where the crime happened) is obstructed by huge rocks. This means she could not have directly witnessed the crucial moment or taken a photo of the fight from that position. Her testimony about seeing—and photographing—the crucial moment is therefore contradicted by the actual physical layout of the bridge as demonstrated in the map.

