The contradiction is between Evidence 5 (the Scarf) and Testimony 5 ("I guess I'm lucky I wasn't wearing a white scarf.").

Explanation: Melissa claims she is lucky she wasn't wearing a *white* scarf, implying that's the color the victim wore. However, the actual scarf (Evidence 5) is blue, not white. This discrepancy proves Melissa previously saw confidential information (the note instructing Valerie to wear a white scarf), which she should not have known; she would not mistake the blue scarf for white by just viewing the scene.

