The contradiction lies between Evidence 10 (Bullet Hole) and Testimony 4 ("Detective Arme fired two warning shots at the figure.").

Cosmos testifies that Detective Arme fired two warning shots at the figure in the lounge, implying two shots should have struck or at least left evidence. However, Evidence 10 shows there was only a single bullet hole found in the boarding lounge (and not two), suggesting that not both warning shots went where Cosmos claims, or that his testimony about the number of shots or their outcome is incorrect.

