The contradiction is between Evidence 2 (May 9th Newspaper) and Testimony 3 (Gale force winds came out of nowhere, so I made an emergency landing at the sanctum!).
The newspaper (Evidence 2) states that the area around the Inner Sanctum will enjoy calm, clear skies, with excellent prayer weather and no mention of strong winds on the day in question. Ihmus claims in his testimony that "gale force winds" forced him to make an emergency landing; however, the official weather report contradicts this, indicating there should have been no such winds around the time of the crime.

