The contradiction is between Evidence 1 (Backstage Diagram) and Testimony 4 ("I was in the yard, but the door was wide open, so I could keep watch on the dressing room.").

The Backstage Diagram describes that when the yard door is open, it blocks the view from the yard to the dressing room. Therefore, Geiru could not have kept watch on the dressing room from the yard while the door was open, directly contradicting her testimony that she could see the dressing room the whole time. 

