Testimony 3 by Nichody states, "But I went against his order. I tore the page out of his notebook, and hid the body." This means he claims to have hidden the body in the lantern in the hold after the crime occurred on the vista deck.

However, Evidence 5 (Broken Lantern) describes the lantern in question as having a bloodstain on the inside wheel handle, as if somebody gripped it with a bloody hand. In the investigation, it's found that the blood got on the inside handle — something only possible if the wheel handle was inside the lantern when the body was being placed in it. However, the restored lantern has the inside and outside wheel handles swapped, suggesting that whoever last assembled it didn't know which side that stained wheel handle was supposed to be on. This discrepancy points toward someone less familiar with the original state of the lantern doing the assembly, contradicting Nichody's claim that he was the one who handled the body and the lantern in the hold. This discrepancy casts doubt on Nichody's testimony about exactly how and when he hid the body, and whether he actually had direct contact with the bloody lantern handle as he claims.

